export default function About() {
  const img="https://media.cntraveler.com/photos/61017da4a41bc3aa30d3b547/1:1/w_https://assets.cntraveller.in/photos/6517a5aa2f98f695fe4e5cdc/4:3/w_5232,h_3924,c_limit/GIGI%20001.jpg"
